bio:
Hard skills:
- Обладаю широкой эрудицией в IT-индустрии;
- Знаю модель OSI и стек протоколов TCP/IP;
- Обладаю опытом работы с серверами на базе ОС GNU/Linux (Ubuntu, Alpine и пр., но предпочитаю Debian);
- Понимаю принцип работы модели клиент/сервер и клиент-серверных технологий;
- Понимаю принцип работы основных сетевых протоколов;
- Обладаю опытом работы с протоколом HTTP - NGINX, Apache, HAProxy, Traefik etc.;
- Обладаю опытом написания скриптов на языке bash;
- Обладаю опытом работы с форматами JSON, YAML и пр.;
- Обладаю опытом работы с таск-трекерами (Jira, Trello, Битрикс24, YouTrack etc.);
- Знаком с подходом "инфраструктура как код" (IaC);
- Могу настроить пул серверов при помощи Ansible;
- Знаком с принципами докеризации приложений и развернуть его в контейнере;
- Могу "задеплоить" окружение при помощи Docker Compose;
- Могу развернуть кластер в Docker Swarm;
- Могу настроить алёрты о недоступности служб из Grafana в  Telegram и на электронную почты;
- Имею представление о принципах работы кластеризации ("ванильный" Kubernetes и Managed K8S от Yandex.Cloud);
- Понимаю важность наличия мониторинга, алёртинга и централизованного менеджмента логов;
- Обладаю опытом работы с виртуализацией (VirtualBox, VMWare и пр.) и контейнеризацией (Docker);
- Знаком с протоколами HTTPS, TLS и mTLS;
- Знаю основы оркестрации (Ansible и Docker Compose);
- Понимаю принципы работы оркестрации, кластеризации, контейнеризации и виртуализации;
- Имею представление о принципах работы сетевой маршрутизации и VPN.

Основной Stack: Debian, Alpine, NGINX, Docker, Docker Compose, Kubernetes, Ansible, Jira, Confluence, YouTrack, Graylog, Apache Kafka, Grafana, Prometheus, OpenSearch, Logstash, GitHub, GitHub Actions, Cloudflare etc.

Soft skills и личные качества:
- Обладаю системным мышлением;
- Знаком с методологиями ITIL и Scrum, культурой DevOps и философией Agile;
- Основные аспекты: самостоятелен и продуктивен;
- Основной фокус: проблематика команды и бизнеса в конкретный момент;
- коммуникативные навыки: умею слушать, учиться и решать конфликтные задачи;
- социальные навыки: обладаю навыками командной работы, всегда готов учиться и чувствую потребность в этом;
- персональные навыки: честен, открыт, ответственен и терпелив;
- способен выстраивать коммуникацию в команде и умею работать с возражениями и негативом.

Хобби и пет-проекты:
- поддерживаю Docker-образ собственной сборки:
https://github.com/ammnt/nginx
- участвую в бета-тестированиях;
- в свободное время занимаюсь самообразованием: читаю статьи, гайды и изучаю английский язык.
